script: |
  super -f text -I q6551.spq | sort > q6551.out

inputs:
  - name: q6551.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 NOT BETWEEN - + ( 77 ) * + - 4 AND + + col0 * - col1 + + col1;
  - name: tab1

outputs:
  - name: q6551.out
    data: |
      51	14	96
      85	5	59
      91	47	68
